        <text>Un appartamento è composto da una o più stanze, ciascuna delle quali ha una lunghezza e una larghezza. Un appartamento è posseduto da uno o più persone.
Un palazzo ha un certo numero di piani ed è composto da uno o più appartamenti. Gli appartamenti di un palazzo hanno un valore al metroquadro diverso per
ogni piano. Deve essere possibile conoscere il valore di un appartamento e il valore immobiliare complessivo posseduto da una persona.</text>
